svg.script:

if(window.parent && window.parent.Wincor && window.parent.Wincor.UI && window.parent.Wincor.UI.Content) {
    let styleRes = window.parent.Wincor.UI.Content.StyleResourceResolver;
    if(styleRes) {
    	let style = document.getElementsByTagName("style")[0];
      	style.innerHTML = style.innerHTML.replace("default/svg.css", styleRes.type() + "svg.css");
       styleRes = null;
    }
}


let id = this.frameElement && this.frameElement.parentElement ? this.frameElement.parentElement.id : "";
if(id === "buttonCancel" || id === "buttonCancelPopup") {
    document.getElementById("line1").setAttribute("class", "strokeColor07");
    document.getElementById("line2").setAttribute("class", "strokeColor07");
}
else if(id === "buttonReturnCard" || id === "buttonCorrect" || id === "buttonCorrectPopup") {
    document.getElementById("line1").setAttribute("class", "strokeColor02");
    document.getElementById("line2").setAttribute("class", "strokeColor02");
}
